import { Component, OnInit } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { Employee } from 'src/app/services/employee';
import { FormGroup, FormBuilder, Validators } from '@angular/forms';
import  *  as pdfMake from 'pdfmake/build/pdfmake';
import * as pdfFonts from 'pdfmake/build/vfs_fonts';
import { FirebaseService } from 'src/app/services/firebase.service';



@Component({
  selector: 'app-payslip-gen',
  templateUrl: './payslip-gen.component.html',
  styleUrls: ['./payslip-gen.component.scss']
})
export class PayslipGenComponent implements OnInit {

  payslipForm: FormGroup;
  item: Employee;
  currentDate = new Date();
  
  quantity: number;
  totalAmount: number;
  bonus: number = 0;
  basic: number;

  validation_messages = {
    'totalDays': [
      { type: 'required', message: 'Please enter total working days.' },
      { type: 'max', message: 'Please enter total working days(<365).' },

    ],
    'salary': [
      { type: 'required', message: 'please enter the basic salary.'},
      { type: 'max', message: 'salary should be less than 100000.' },
    ],
  };

  constructor(private route: ActivatedRoute, private fb: FormBuilder, private router: Router, private firebaseService: FirebaseService) { }

  ngOnInit(): void {
    pdfMake.vfs = pdfFonts.pdfMake.vfs;
    this.route.data.subscribe(routeData => {
      let data = routeData['data']
      console.log(data)
      if(data) {
        this.item = data.payload.data();
        this.item.id = data.payload.id;
        this.createForm();
      }
    })
  }

  lastPayslipInit() {
    const dateComp = new Date(0);
    if(this.item.lastPayslip > dateComp) {
      return true;
    }
    return false;
  }

  createForm() {
    this.payslipForm = this.fb.group({
      totalDays: ['', [Validators.required, Validators.max(365)]],
      salary: ['', [Validators.required, Validators.max(100000)]],
      bonus: ['', [Validators.max(100000)]],
    })
  }

  onSubmit(value) { 
    this.basic = parseInt(value.salary);
    this.quantity = parseInt(value.totalDays);
    this.bonus =value.bonus ? parseInt(value.bonus) : 0;
    this.totalAmount = (this.basic*this.quantity) + this.bonus;
    value.lastPayslip = this.currentDate.toDateString();
    this.firebaseService.updatePayslip(this.item.id, value.lastPayslip);
    const docDefinition = this.getDocumentDefinition();
    pdfMake.createPdf(docDefinition).open();
  }

  getDocumentDefinition() {
    return {
      info: {
        title: 'Payslip: ' + this.item.firstName + this.currentDate.toDateString()
      },
      content: [
        {
          columns: [
            [{
              image: 'data:image/png;base64,',
              fit: [100,100],
              style: 'imageStyle'
            },
            {
              text: this.item.firstName + this.item.lastName,
              style: 'name'
            },
            {
              text: this.item.email
            },
            {
              text: this.item.mobileNumber
            }],
            [
              {
                text: 'PAYSLIP',
                style: 'title'
              }
            ],
            [
              {
                text: 'Date: ' + this.currentDate.toDateString(),
                style: 'date'
              },
            ],
          ]
        
        },

        {
          style: 'tableExample',
          table: {
            headerRows: 1,
            widths: ['auto','*',90,'auto', 'auto'],
            body: [
              [{text: 'S.No', style: 'tableHeader'}, {text: 'Category', style: 'tableHeader'}, {text: 'Basis', style: 'tableHeader'}, {text: 'Quantity', style: 'tableHeader'}, {text: 'Amount', style: 'tableHeader'}],
              ['1', {text: 'Basic Salary', style: {bold: 'true'}}, {text: this.basic, style: 'tableTextRight'}, {text: this.quantity, style: 'tableTextRight'}, {text: (this.basic*this.quantity), style: 'tableTextRight'}],
              ['2', {text: 'Bonus', style: {bold: 'true'}}, {text: this.bonus, style: 'tableTextRight'}, {text: '1', style: 'tableTextRight'}, {text: this.bonus, style: 'tableTextRight'}]
            ]
          },
          layout: 'headerLineOnly'
        },
        
        {
          text: 'Total Amount: Rs.'+ this.totalAmount,
          style: 'totalAmount'
        },
        {
          style: 'tableExample2',
          table: {
            widths: ['*'],
            body: [
              [
                {
                  border: [false, true, false, true],
                  fillColor: '#cccccc',
                  style: 'tableHeader2',
                  text: 'Signature: \t\t\t\t'
                },
              ],
            ]
          },
          layout: {
            defaultBorder: false,
          }
        },

        ],
    styles: {
      name: {
        fontSize: 14,
        bold: true
      },
      date: {
        fontSize: 14,
        alignment: 'right',
        margin: [60,80,0,0]
      },
      totalAmount: {
        fontSize: 14,
        alignment: 'right',
        bold: true,
        margin: [0, 8, 0, 40]
      },
      title: {
        decoration: 'underline',
        margin: [40,80,0,0]
      },
      header: {
        fontSize: 18,
        bold: true,
        margin: [0, 0, 0, 10]
      },
      subheader: {
        fontSize: 16,
        bold: true,
        margin: [0, 10, 0, 5]
      },
      tableExample: {
        margin: [0, 35, 0, 15]
      },
      tableExample2: {
        alignment: 'right',
        margin: [0, 25, 0, 25]
      },
      imageStyle: {
        alignment: 'left',
        margin: [2,10,0,20]
      },
      tableHeader: {
        bold: true,
        fontSize: 13,
        color: 'black',
        margin: [0,0,0,5]
      },
      tableHeader2: {
        bold: true,
        fontSize: 13,
        color: 'black',
        margin: [0,0,10,0]
      },
      tableTextRight: {
        alignment: 'right'
      }
    },
    }
  }


  cancel() {
    this.router.navigate(['/home']);
  }
}
